INSERT INTO `t_emission` (`r_i`, `r_nom`, `r_image`, `r_desc`, `r_ichaine`, `r_ithematique`, `r_status`, `r_date`, `r_mots_cle`) VALUES
(1, 'VENDREDI SOIR', '128', 'Moment inédit de comédie. En compagnie de nombreux invités, Fou rire nous offre un condensé d\'humour. L\'occasion de voir ou de revoir les sketches inoubliables des plus grands humoristes et de découvrir la nouvelle génération.', 1, 1, 1, '2018-10-31 02:18:18', ''),
(2, 'CMIDI', '129', 'Caroline Dasylva est aux commandes de cet incontournable rendez-vous TV de la mi-journée. Entourée de ses chroniqueurs, elle reçoit les personnalités qui sont au cœur de l’actualité. Au programme: culture, cinéma, nouvelles technologies, astuces beauté… Une variété de thèmes abordés dans la bonne humeur.\r\nRendez-vous du Lundi au Vendredi à 12 h 00 sur #RTI1 et sur l’application RTI Mobile', 1, 1, 1, '2018-10-31 02:18:18', ''),
(3, 'MODE O BUDGET', '130', 'une télé-réalité dans laquelle Séry Dorcas qui est aussi coach en image de beauté, mettra ses compétences aux services de certaines jeunes femmes. Une émission qui met en valeur, les styles vestimentaires et la beauté féminine, peu importe la bourse de la candidate', 1, 1, 1, '2018-10-31 02:18:18', ''),
(4, 'MATIN BONHEUR', '131', 'Démarrer la journée du bon pied grâce au pep’s et à la joie de vivre très communicative Alix et Marco. Matin Bonheur c’est le rendez-vous matinal qui vous propose une revue de presse et une photo de la vie quotidienne à travers différents rubriques : culture, mode, santé, vie pratique, droit …et tout cela dans la bonne humeur.', 1, 1, 1, '2018-10-31 02:18:18', ''),
(5, 'DESSINS ANIMES', '132', 'Place aux déssins annimés. Chaque week end découvrez votre déssin animé préféré sur RTI Bouaké', 1, 1, 1, '2018-10-31 02:18:18', ''),
(6, 'MADE IN AFRICA', '10', 'Made In Africa est votre nouveau magazine économique mensuel proposé par RTI1. Des reportages, des enquêtes, des débats avec les principaux acteurs de l’économie Africaine.', 1, 2, 1, '2018-10-31 02:26:12', ''),
(7, '52 MN POUR COMPRENDRE', '11', 'Un 52 min tout en image, rythmé par les reportages et les plateaux en situation sur les lieux où l’on tourne.', 1, 2, 1, '2018-10-31 02:26:12', ''),
