(102, 'JT 13H', '117', '\"L\'édition des informations nationales et internationales de la mi-journée de RTI1 en Replay. \r\n\"', 1, 2, 1, '2018-10-31 02:40:28', ''),
(103, 'Le Flash en image', '257', 'toute l\'actualité nationale et internationale en images', 1, 2, 1, '2018-10-31 02:40:28', ''),
(104, 'TERRES SAUVAGES', '133', 'Luke et Hannah Morgan quittent leur Kansas natal pour rejoindre leur père Jubal à Denvers. C\'est ainsi que commence leur aventure sensationnelle à travers la frontière magnifique et mystérieuse connue comme étant la terre sauvage. La chanteuse Mandy Mc Cullough et Clara Tilton, fine gâchette, se joignent aux deux héros.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(105, 'L\'IMPARDONNABLE', '134', 'Martín Santelmo arrive dans un village appelé Mina Escondida, \"mine cachée\", étant à la recherche de son frère Demetrio Silveira. Malheureusement, une fois sur place, il apprend que son frère s\'est suicidé à cause d\'une femme ambitieuse et prête à tout pour l\'argent. Plein d\'amertume, Martín décide de partir à la recherche de cette femme et de mettre en place sa vengeance. Les jours passent, Martín parvient à trouver des pistes qui l\'amènent jusqu\'à Mexico, la capitale mexicaine, chez la famille Prado Castelo. Comme preuve, la femme pour laquelle Demetrio s\'était suicidé, portait un collier en or sur lequel était gravée l\'initiale \" V \", collier que Martín a récupéré. Arrivé chez les Prado Castelo, Martín fait la connaissance des deux cousines. Virginia est une femme innocente et fragile tandis que Verónica est une femme forte et courageuse. Sans connaître la coupable, Martín est trompé par une série de coïncidences et de rumeurs et finit par croire que la femme qu\'il cherche est Verónica. De ce fait, Martín commence sa vengeance jusqu\'à que Verónica tombe amoureuse, mais sans le vouloir. Celui qui en sortira perdant et follement amoureux sera lui-même.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(106, 'BABIWOOD / BLOG', '135', '\"Une femme à la retraite, rongée par l’ennui, décide de créer un blog sur le conseil de sa fille. Ayant pris goût à l’écriture lorsqu’elle était au lycée, écrire à nouveau des chroniques sur internet est une idée qui l’enthousiasme énormément. Après avoir passé en revue toutes les idées possibles, elle trouve enfin « le » sujet qui, elle le sait, ne tarira jamais de rebondissements: la vie passionnante de Luc et Alice, ses voisins. Ils sont beaux, jeunes et surtout ils leur arrivent toujours mille et une péripéties. Décidée à rester anonyme, notre bloggeuse nous introduit dans les aventures d’un couple aussi drôle qu’attachant.\r\n\"', 1, 4, 1, '2018-10-31 02:42:42', ''),
(107, 'BABIWOOD', '136', 'rti 1', 1, 4, 1, '2018-10-31 02:42:42', ''),
(108, 'BABIWOOD / 30-40', '137', '20.30.40 raconte l’histoire de 3 femmes de la cité Abidjanaise, d’origines différentes, de statuts, de looks et surtout d’âges différents qui se croisent dans des circonstances inattendues et se lient d’amitié.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(109, 'BABIWOOD / SŒURS ENNEMIES 2', '138', 'Kyana et Keyla, ses filles, sont deux jeunes femmes travailleuses, intelligentes et très attachées aux valeurs familiales. Tout allait bien jusqu’à ce qu’Éric, le fils du voisin rentre de France. Ce jeune homme beau et intelligent ne se fait pas longtemps prier pour s’attirer les faveurs de Keyla, au grand mécontentement du père. Tout cela se fait à l’insu de Kyana qui trouve aussi refuge dans les bras d’Éric après avoir appris que son père n’était pas son vrai père…', 1, 4, 1, '2018-10-31 02:42:42', ''),
(110, 'BABIWOOD / NATIONAL SECURITY 2', '139', 'Vu l’insécurité grandissante qui règne dans le pays, le Président de la République décide de créer une police sécrète dénommée « National Security » ou « Sécurité Nationale » et qui travaille sous le sigle NS.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(111, 'BABIWOOD / INTRIGUE A BABI', '140', 'rti 1', 1, 4, 1, '2018-10-31 02:42:42', ''),
(112, 'FOYER POLYGAMIQUE', '141', '« Foyer polygamique » aussi connu sous le nom de « Les déballeurs » est une série camerounaise produite par les Studios 2, réalisée par Ghislain Fotso et mise en scène par Ebenezer Kepombia (Mitumba)', 1, 4, 1, '2018-10-31 02:42:42', ''),
(113, 'THE WILD', '142', 'Cheryl Strayed se prépare à effectuer l\'un des treks les plus difficiles et sauvages des États-Unis. Elle se lance à l\'assaut du Pacific Crest Trail, le sentier de randonnée qui traverse le pays, de la frontière mexicaine jusqu\'au Canada. Il lui faudra trois mois de marche pour en venir à bout...', 1, 4, 1, '2018-10-31 02:42:42', ''),
(114, 'TOTALEMENT DIVA', '143', 'Totalement diva est l\'histoire d\'une jeune fille vivant dans les rues qui un jour, rencontre le propriétaire d\'une agence de mannequins trés réputée et lui offre une chance de travailler pour lui.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(115, 'SERIE QUANTICO', '144', 'De jeunes recrues du FBI ont été évaluées au camp d\'entraînement de Quantico en Virginie où leurs compétences ont été mises à rude épreuve. Neuf mois plus tard, l\'une de ces jeunes recrues, Alexandra Parrish, est accusée d\'avoir perpétré un attentat à la bombe visant la gare de Grand Central à New York.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(116, 'SERIE:FICTION IVOIRIENNE', '145', 'rti 1', 1, 4, 1, '2018-10-31 02:42:42', ''),
(117, 'CINE NUIT', '146', 'rti 1', 1, 4, 1, '2018-10-31 02:42:42', ''),
(118, 'JONGO', '147', 'Eli King a reçu en héritage de la part de son défunt père un étrange cristal bleu, dont il découvre qu’il lui confère des pouvoirs surnaturels. Doté désormais d’une force et d’une vitesse hors du commun, Eli réalise que la pierre a un rapport avec la mort de son père, un mineur. Tandis qu’il recherche ses meurtriers, Eli comprendre aussi comment son père et le cristal bleu ont pu être liés. En enquêtant ainsi sur les circonstances du décès de son père, il s’aperçoit qu’il ne s’agit pas du seul cristal de ce type : il en existe deux autres, un vert et un rouge, ayant chacun des propriétés différentes…Mais ce qu’Eli King ignore, c\'est que ceux qu\'il poursuit ont leurs propres cristaux et ont besoin de sa pierre pour accomplir une prophétie ancienne et dévastatrice qui menacera la vie de millions de personnes.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(119, 'SERIE US PLAYERS', '148', 'A Las Vegas, Alex Kane, un ancien sniper devenu agent de sécurité réputé qui vient de perdre sa femme, est plongé au coeur d\'une mystérieuse conspiration. Il fait partie du Jeu, qui consiste à compléter une série d\'actions héroïques où il doit sauver la vie d\'innocents. De riches anonymes parient sur lui. Il est le pion... #THEPLAYER à voir tous les Lundis à 20h50 sur #RTI1', 1, 4, 1, '2018-10-31 02:42:42', ''),
(120, 'CAMPUS', '149', 'Pendant la période de diffusion de «UNITE SPECIALE» sur Rti Première, le producteur réalisateur du film, Chahin Sombo est approché par une dame dans un hypermarché d’Abidjan. La dame interpelle en ces termes : ‘’M. Sombo, mes enfants et moi sommes très admiratifs de «UNITE SPECIALE» ; mais mes enfants se appropriés le film au point qu’ils essaient d’incarner les acteurs dans leurs jeux. Mais les pistolets utilisés par les acteurs peuvent avoir une influence négative sur eux. Si vous pouvez revoir la manière de réaliser ce film sans l’utilisation de pistolet, cela sera bénéfique pour le futur de mes enfants’’.', 1, 4, 1, '2018-10-31 02:42:42', ''),
(121, 'VARIETE SELECT IVOIRE', '122', 'La variété musicale ivoirienne la mieux choisie  c\'est  chaque semaine sur RTI 1', 1, 5, 1, '2018-10-31 02:44:13', ''),
(122, 'VARIETE CLIP STAR', '123', 'La selection de clip la mieux choisie  c\'est  chaque semaine sur RTI1', 1, 5, 1, '2018-10-31 02:44:13', ''),
(123, 'VARIETE NIGHT', '124', 'La variété musicale entièrement dédiée à la nuit  c\'est  chaque semaine sur RTI 1', 1, 5, 1, '2018-10-31 02:44:13', ''),
(124, 'SELECTION CHRETIENNE', '125', 'Découvrez dans la selection chrétienne, un concentré de musique chrétienne chaque semaine sur RTI 2', 1, 5, 1, '2018-10-31 02:44:13', ''),
(125, 'TEMPO', '126', 'Tempo, la grande émission dédiée à la musique ivoirienne et africaine, est de retour avec Didier Bléou.', 1, 5, 1, '2018-10-31 02:44:13', ''),
(126, '100% COUPÉ DÉCALÉ', '161', '100% Coupé Décalé est une selection musicale extraite du genre musical ivoirien coupé-décalé Playlist, interview d\'artiste font le menu de celle ballade Décalée au micro du mannequin des arrangeurs Serge Beynaud', 2, 5, 1, '2018-10-31 02:47:20', ''),
(127, '100% ZOUGLOU', '162', 'Eric Patron plante le décor autour d\'un univers entièrement dédié au Zouglou. 100% Zouglou reçoit chaque semaine un artiste ou un groupe Zouglou autour d\'une selection du genre musical ivoirien Zouglou', 2, 5, 1, '2018-10-31 02:47:20', ''),
(128, '100% HIP HOP', '163', 'Ozone AfrikBamba prend rendez-vous avec les meilleurs rappeurs en herbe ou confirmés chaque semaine autour d\'une playlist de musique Hip hop.', 2, 5, 1, '2018-10-31 02:47:20', ''),
(129, 'MIX SEULEMENT', '164', 'Mix seulement est un tour musical composé entièrement par un dj de la place sur les meilleurs clips qui ont marqué le moment', 2, 5, 1, '2018-10-31 02:47:20', ''),
(130, 'HIT', '165', 'HIT, un saupoudré de sonorités musicales, de musique urbaines, de variétés d\'ici et d\'ailleurs', 2, 5, 1, '2018-10-31 02:47:20', ''),
(131, 'BEACH DE LA 2', '166', 'Le Beach de la 2 est un cocktail de sonorités musicales ivoiriennes d\'artistes en herbe et confirmés. Un mini concert orchestré par Eric Sekongo', 2, 5, 1, '2018-10-31 02:47:20', ''),
(132, 'DIVERTISSEMENT URBAN', '167', 'rti 2', 2, 5, 1, '2018-10-31 02:47:20', ''),
(133, 'TONNERRE', '168', 'Tonnerre met en scène une pleiade d\'artistes en herbe et confirmés sur une scène à travers le pays', 2, 5, 1, '2018-10-31 02:47:20', ''),
(134, '100% FEMME', '169', 'Faire découvrir, rapprocher le téléspectateur des différents univers dans lesquels les femmes se meuvent : Secteur Informel, Foyer, Etudes, Entrepreneuriat, Hautes fonctions… dans le but de les cerner, les connaitre, les décoder et enfin les comprendre.', 2, 1, 1, '2018-10-31 02:49:11', ''),
(135, 'SERIE JEUNESSE', '170', 'Découvrez tout un univers d\'adolescent dans des séries inédites', 2, 1, 1, '2018-10-31 02:49:11', ''),
(136, 'PAD DIVERTISSEMENT', '171', 'rti 2', 2, 1, 1, '2018-10-31 02:49:11', ''),
(137, 'Madame Monsieur Bonsoir', '258', 'Madame, Monsieur, bonsoir ! est un magazine qui traite des faits de notre société à travers le regard de Willy Dumbo et de ses fidèles compagnons : Annie Blackman, Josué Gnawa, et Daysie. Tous les soirs, prenez la parole et participez à l\'émission en donnant votre avis sur le débat du jour.', 2, 1, 1, '2018-10-31 02:49:11', ''),
(138, 'TRESOR DU MONDE', '150', '« Les Trésors du monde »  permet aux plus jeunes d’être acteur de leur croissance tout en se divertissant à travers des rubriques bien élaborées.', 2, 2, 1, '2018-10-31 02:51:27', ''),
