(149, 'LES CHOIX DE L\'AMOUR', '172', 'Dans la ville de Agua Azul vit une jeune fille de la bonne société dont la famille est ruinée. Elle tombe amoureuse d\'un jeune marin pauvre.', 2, 4, 1, '2018-10-31 02:55:28', ''),
(150, 'SUBLIME MENSONGE', '173', 'L\'amour maternel, La plus complexe, sublime et presque toujours conflictuelle forme d\'aimer. De cet thématique, apparemment simple et innocente, l\'auteur Manoel Carlos a extrait un des plus denses et intrigants romans adapté par le TV Globe .Mère et fille dans le feuilleton, Regina Duarte et Gabriela Duarte le sont aussi dans la vie.Les premiers épisodes du feuilleton se déroulent à vénise et y ont été tournés. Ici encore une fois, il s\'agit d\'amour : l\'amour d\'une mère pour sa fille, un amour à la limite du sacrifice. Ce sacrifice sera un enfant.', 2, 4, 1, '2018-10-31 02:55:28', ''),
(151, 'BIN KOUCH', '174', 'C\'est l\'histoire de trois sœurs qui vivent à Jaipur. Abha l\'aîné dirige une cantine appelée la cantine Kohli . Elle a un fils appelé Aryan. Rhea, la deuxième soeur veut être une rockstar et Myra la plus jeune souhaite devenir journaliste.', 2, 4, 1, '2018-10-31 02:55:28', ''),
(152, 'GANGAA', '175', 'L’histoire gravite autour d’une jeune femme devenu veuve le jour même de son mariage, après que son mari et son père sont tués dans une émeute sur la rive du Gange dans la ville indienne de Vârânasî. Le feuilleton a remporté le premier prix du meilleur programme avec un message social aux Indian Telly Awards en 2015 grâce à son scénario qui a contribué à la sensiblisations sur les droits des veuves au pays du mahatma Gandhi.', 2, 4, 1, '2018-10-31 02:55:28', ''),
(153, 'DIVORCE COURT', '176', 'Divorce Court est un tribunal américain non traditionnel qui se consacre au règlement des différends entre couples divorcés . L\'édition actuelle de la Cour de divorce, créée en septembre 1999, est une émission de téléréalité basée sur l\'arbitrage présidée par Lynn Toler , une ancienne juge de la cour municipale de Cleveland Heights, dans l\'Ohio . Cette série met en scène un tribunal spécialisé dans des affaires de divorce.', 2, 4, 1, '2018-10-31 02:55:28', ''),
